import React from "react";
import styleAbout from "./About.module.css";

const About = () => {
  return (
    <section className={styleAbout.body}>
      <div className={styleAbout.container}>
        <h1>share your photos from your event with FaceRecognation </h1>
      </div>
    </section>
  );
};

export default About;
